import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import SideNavbar from "../../components/Doctor/sidenavbar";
import Navbar from "../../components/Doctor/Navbar";
import "../../css/Doctor/ddashboard.css";

export default function UploadSchedule() {
  // Define dummy schedule data
  const schedule = {
    "slots": [
      [2024, 4, 5, 9, 0],
      [2024, 4, 5, 9, 45],
      [2024, 4, 5, 10, 30],
      [2024, 4, 5, 11, 15],
      [2024, 4, 5, 12, 0],
      [2024, 4, 5, 12, 45],
      [2024, 4, 5, 13, 30],
      [2024, 4, 5, 14, 15],
      [2024, 4, 5, 15, 0],
      [2024, 4, 5, 15, 45],
    ],
    "appointments": [
      { id: 1, date: [2024, 4, 5], time: '09:00', patientName: 'John Doe' },
      { id: 2, date: [2024, 4, 6], time: '10:30', patientName: 'somebody someone' },
      { id: 3, date: [2024, 4, 7], time: '11:15', patientName: 'Alice Smith' },
      { id: 5, date: [2024, 4, 6], time: '09:00', patientName: 'John Doe' },
    ]
  };

  // State for editing mode
  const [isEditing, setIsEditing] = useState(false);

  // Function to toggle editing mode
  const handleEdit = () => {
    setIsEditing(!isEditing);
  };

  // Function to handle cell click (toggle availability)
  const handleCellClick = (dateIndex, timeIndex) => {
    if (isEditing) {
      // Implement your logic for editing mode here
    }
  };

  // Function to generate table rows
  const generateScheduleRows = () => {
    const rows = [];

    for (let i = 0; i < schedule.slots.length; i++) {
      const slot = schedule.slots[i];
      const [year, month, day, hour, minute] = slot;
      const dateKey = `${year}-${month}-${day}`;
      const timeKey = `${hour}:${minute}`;

      const isSlotAvailable = schedule.appointments.some(appointment =>
        appointment.date[0] === year &&
        appointment.date[1] === month &&
        appointment.date[2] === day &&
        appointment.time === timeKey
      );

      const cellClass = isSlotAvailable ? 'table-danger bg-danger text-dark' : 'table-success bg-success text-white';

      rows.push(
        <tr key={dateKey}>
          <th scope="row">{dateKey}</th>
          {schedule.slots.map((slot, index) => {
            const [slotYear, slotMonth, slotDay, slotHour, slotMinute] = slot;
            const slotTimeKey = `${slotHour}:${slotMinute}`;

            const cellClass = isSlotAvailable ? 'table-danger bg-danger text-dark' : 'table-success bg-success text-white';

            return (
              <td
                key={`${dateKey}-${slotTimeKey}`}
                className={cellClass}
                onClick={() => handleCellClick(dateKey, slotTimeKey)}
              ></td>
            );
          })}
        </tr>
      );
    }

    return rows;
  };

  return (
    <div className='dashboard-container'>
      <Navbar />
      <div className= 'dashboard-content'>
        <SideNavbar />
        <div className="main-content">
          <h2>This week's Schedule</h2>
          <table className="table table-bordered custom-box khus">
            <thead>
              <tr>
                <th></th>
                <th>9:00 AM</th>
                <th>9:45 AM</th>
                <th>10:30 AM</th>
                <th>11:15 AM</th>
                <th>12:00 PM</th>
                <th>12:45 PM</th>
                <th>1:30 PM</th>
                <th>2:15 PM</th>
                <th>3:00 PM</th>
                <th>3:45 PM</th>
              </tr>
            </thead>
            <tbody>
              {generateScheduleRows()}
            </tbody>
          </table>

          <button type="button" className="btn btn-primary custom-button" onClick={handleEdit}>
            {isEditing ? 'Cancel Edit' : 'Edit Schedule'}
          </button>
          {isEditing && (
            <button type="button" className="btn btn-primary custom-button" onClick={handleSubmit}>
              Submit
            </button>
          )}
        </div>
      </div>
    </div>
  );
}
